import React from 'react';


function Food(fav) {
  return (
    <h3>I like {fav}</h3>
  );
}


function App() {
  return (
    <div>
      text
      <Food fav= "chicken"/>
      <Food fav= "salmon"/>
      <Food fav= "beer"/>
      <Food fav= "beef"/>
    </div>
  );
}

export default App;
